import styled from "styled-components";

export const StyledCostFooter = styled.div`

    display: flex;
    align-items: center;
    width: 1920px;
    height: 30px ;
    background-color: #e4e4e7;
    border: 1px solid black;
    border-radius: 3px;
    margin: 20px 10px 10px 10px;

    div {
        margin: 5px;
        display: flex;
        flex-direction: row;
    }
    div > div{
        
        display: flex;
        flex-direction: row;
        align-items: center;
        margin: 2px;
        font-weight: 450;
    }
 
`;
